insert into fitnesstypes (id, description, duration, goals, images, intensity, name, type) values (1, 'One of the most popular activities in gyms around the world.\r\nDynamic, intense, and very motivating. Get ready to sweat and burn a lot of calories while listening to the best music.', '35/45 minutes', 'Fat Loss.\r\nToning.\r\nImproved Cardiovascular Resistance', 'img/cycle.jpg;img/cycle2.jpg;img/cycle3.jpg', 'medium/high', 'Cycling', 'Cardiovascular, Low Impact, Coordination');
insert into fitnesstypes (id, description, duration, goals, images, intensity, name, type) values (2, 'Pilates, through its exercises, strengthens weak muscles, stretches muscles that are shortened and increases joint mobility.', '45/50 minutes', 'Improved posture. Strength. Flexibility and relaxation', 'img/pilates4.jpg;img/pilates2.jpg;img/pilates9.jpg', 'medium', 'pilates', 'Abdominal, Low Impact, Flexibility');
insert into fitnesstypes (id, description, duration, goals, images, intensity, name, type) values (3, 'Zumba mixes Latin dance moves such as samba and reggaeton, or even other styles such as hip hop and belly dancing with cardio training exercises.\r\nIt is a class that allows access to anyone because the level of complexity is low and where the most', '45 minutes', 'Weight loss. Fun. Dancing. Cardiovascular Endurance Improvement', 'img/zumba7.jpg;img/zumbaa.jpg', 'medium', 'zumba', 'Cardiovascular, Low Impact, Coordination');
insert into fitnesstypes (id, description, duration, goals, images, intensity, name, type) values (4, 'Crossfit is a strength training and general fitness program based on functional movements, performed at high intensity and constantly varied.\r\n\r\nCurrently, CrossFit is one of the fastest growing training methods in the world.', '45 minutes', 'Fat loss. Strength improvement. Endurance. Flexibility. Exercise diversity. Improvement of body composition', 'img/crossfit6.jpg;img/crossfit7.jpg', 'high', 'crossfit', 'Strength, Endurance, Flexibility, Motor coordination and balance');
insert into fitnesstypes (id, description, duration, goals, images, intensity, name, type) values (5, 'The practice of Yoga gives you balance, strength and a sense of well-being through proper alignment and conscious body actions.\r\nIt uses postures and conscious breathing in combination with mental focus.', '50 minutes', 'Relaxation. Flexibility. Posture improvement', 'img/yoga2.jpg;img/yoga7.jpg', 'medium/low', 'yoga', 'Body and Mind, Flexibility, Stretching, Low Impact');
insert into fitnesstypes (id, description, duration, goals, images, intensity, name, type) values (6, 'The Body Pump class strengthens and tones all major muscle groups through a series of squats, presses, lifts and curls.\r\nWe will prepare you to lift everything that may come your way.', '45 minutes', 'Fat loss. Toning. Improvement of body composition', 'img/bodypump.webp;img/bodypump2.jpg;img/bodypumpp.jpg', 'medium/high', 'bodypump', 'Strength');
insert into fitnesstypes (id, description, duration, goals, images, intensity, name, type) values (7, 'Set of exercises and games to work on agility, muscular endurance, strength, cardiorespiratory capacity and motor coordination.\r\n\r\nEach student trains at their own pace, in a playful and healthy way.', '45 minutes', '', 'img/circuit1.jpg;img/circuit4.jpg;img/circuit5.jpg', 'medium/high', 'circuit', '\r\nStrength, coordination, endurance and agility');
insert into fitnesstypes (id, description, duration, goals, images, intensity, name, type) values (8, 'You don\'t always have the strength to do everything, but the secret is to look for your inner strength.\r\n\r\nOur TRX (Total Resistance Exercise) class combines several resistance exercises, which will give you an extra dose of energy.', '30/45 minutes', 'Improved strength. Endurance. Flexibility. Cardio-respiratory capacity', 'img/trx1.jpg;img/trx6.jpg', 'medium/high', 'trx', 'Suspension training, strength, full body');